import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './Header.css';

class Header extends Component {
  render() {
    return (
      <div className="App">
        Hello
        <li><Link to="/home">Home</Link></li>
      </div>
    );
  }
}

export default Header;
